import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={styles.navbar}>
      <ul style={styles.navList}>
        <li style={styles.navItem}>
          <div style={styles.itemBox}>
            <Link to="/" style={styles.link}>Home</Link>
          </div>
        </li>
        <li style={styles.navItem}>
          <div style={styles.itemBox}>
            <Link to="/about" style={styles.link}>About Us</Link>
          </div>
        </li>
        <li style={styles.navItem}>
          <div style={styles.itemBox}>
            <Link to="/contact" style={styles.link}>Contact</Link>
          </div>
        </li>
        <li style={styles.navItem}>
          <div style={styles.itemBox}>
            <Link to="/dashboard" style={styles.link}>COVID-Dashboard</Link>
          </div>
        </li>
      </ul>
    </nav>
  );
};

const styles = {
  navbar: {
    background: "green",
    padding: "15px",
    display: "flex",
    justifyContent: "center",
  },
  navList: {
    display: "flex",
    listStyle: "none",
    margin: 0,
    padding: 0,
    flexWrap: "wrap", // Wrap items on smaller screens
  },
  navItem: {
    marginRight: "10px",
  },
  itemBox: {
    backgroundColor: "rgba(255, 255, 255, 0.1)", // Semi-transparent box for each item
    padding: "10px 15px",
    borderRadius: "8px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)",
  },
  link: {
    color: "#fff",
    textDecoration: "none",
    fontSize: "20px",
  },

  // Media query for smaller screens
  '@media (max-width: 600px)': {
    navbar: {
      padding: "10px",
    },
    navList: {
      flexDirection: "column", // Stack items vertically
      alignItems: "center",
    },
    navItem: {
      marginBottom: "10px", // Space between items in the column
    },
    itemBox: {
      padding: "8px 12px", // Adjust padding for smaller screens
    },
    link: {
      fontSize: "18px", // Adjust font size for smaller screens
    },
  },
};

export default Navbar;
